    public static boolean isSupport(StockDataTypes[] wantGetStockDatas) {
        if (wantGetStockDatas == null){
            return false;
        }
        for (StockDataTypes wantGetStockData : wantGetStockDatas) {
            if (wantGetStockData.equals(StockDataTypes.MinuteFunds)) {
                return true;
            }
        }
        return false;
    }

    //大单50-100w
    //超大单100w以上
    //中性盘就是分不清主动性成交量。主动性买盘是指你现在以卖一或更高的价格买入主动股票所成交的盘量，主动性卖盘是指你现在以买一或更低的价格卖出股票所成交的盘量，那么现在两笔主动性的单子同时打出并成交就称为中性盘。
//    kind: "U" 买盘
//    kind: "D" 卖盘
//    kind: "E" 中性盘
    @Override
    public JSONArray decoratorData(JSONArray minutePriceDatas){
        customBigAmountStruckDeal(minuteFundsData);
        int i1 = minuteFundsData.size() - 1;
        for (int i = 0; i < minutePriceDatas.size(); ) {
            JSONObject minutePriceData = (JSONObject)minutePriceDatas.get(i);
            String time = minutePriceData.getString("datetime").substring(6,11);//12-13 10:08

            minutePriceData.put("大单成交额super、big、total","");
            minutePriceDatas.set(i,minutePriceData);
            String s = null;
            for (; i1 >= 0; ) {
                JSONObject fundsData = (JSONObject)minuteFundsData.get(i1);
                String ticktime = fundsData.getString("ticktime").substring(0,5);

                String specialTicktime1 = "09:20;09:21;09:22;09:23;09:24;09:25;09:26;09:27;09:28;09:29;09:30";
                if (specialTicktime1.contains(ticktime)) {ticktime = "09:30";}
                String specialTicktime2 = "13:00;";
                if (specialTicktime2.contains(ticktime)) {
                    ticktime = "13:01";
                }

                if (time.equals(ticktime)){
                    s= "s:"+fundsData.getBigDecimal("superBigAmountTotal").divide(new BigDecimal(GuMinuteDataUtils.tenThousand),1,BigDecimal.ROUND_HALF_UP) +"万;" +"b:"+fundsData.getBigDecimal("bigAmountTotal").divide(new BigDecimal(GuMinuteDataUtils.tenThousand),1,BigDecimal.ROUND_HALF_UP) +"万;"+"t:"+fundsData.getBigDecimal("amountTotal").divide(new BigDecimal(GuMinuteDataUtils.tenThousand),1,BigDecimal.ROUND_HALF_UP) +"万;" ;
                    minutePriceData.put("大单成交额super、big、total",s);
                } else {
                    i++;
                    minutePriceDatas.set(i-1,minutePriceData);
                    break;
                }
                i1--;
            }
            //为什么这里要i1 < 0在i++。因为i1数组的数量可能比i先走完，所以i就一直卡着 走不完 死循环
            if (i1 < 0){
                i++;
            }
        }
        return minutePriceDatas;
    }
    @Override
    public StringBuilder decoratorDataTableString(StringBuilder tableString){
        customBigAmountStruckDeal(minuteFundsData);
        if (minuteFundsData.size() == 0){return tableString;}
        JSONObject jsonObject = minuteFundsData.getJSONObject(0);
        String s = jsonObject.getBigDecimal("superBigAmountTotal").divide(new BigDecimal(GuMinuteDataUtils.tenThousand),1,BigDecimal.ROUND_HALF_UP) +"万;";
        String b = jsonObject.getBigDecimal("bigAmountTotal").divide(new BigDecimal(GuMinuteDataUtils.tenThousand),1,BigDecimal.ROUND_HALF_UP) +"万;";
        String t = jsonObject.getBigDecimal("amountTotal").divide(new BigDecimal(GuMinuteDataUtils.tenThousand),1,BigDecimal.ROUND_HALF_UP) +"万;";

        String ddmrl = "超大单总额："+ s + "大单总额："+ b + "大单总额："+ t;
        tableString.append(ddmrl);
        tableString.append(System.getProperty("line.separator"));
        return tableString;
    }
    private static Map<String,BigDecimal> computeDD(BigDecimal superBigAmountTotal, BigDecimal bigAmountTotal,BigDecimal amountTotal,  JSONObject jsonObject){
        Map<String,BigDecimal> result = new HashMap<>();
        result.put("bigAmountTotal",bigAmountTotal);
        result.put("superBigAmountTotal",superBigAmountTotal);
        result.put("amountTotal",superBigAmountTotal);


        String kind = jsonObject.getString("kind");
        BigDecimal volume = new BigDecimal(jsonObject.getString("volume"));
        BigDecimal price = new BigDecimal(jsonObject.getString("price"));
        BigDecimal value = volume.multiply(price);
        //左边小于右边-大单
        if (value.compareTo(bigAmount) < 0){
            if ("U".equals(kind)){
                bigAmountTotal = bigAmountTotal.add(value);
            } else if ("D".equals(kind)){
                bigAmountTotal = bigAmountTotal.subtract(value);
            }
//                else if ("E".equals(kind)){
//                    bigAmountTotal = bigAmountTotal.subtract(value);
//                }
            result.put("bigAmountTotal",bigAmountTotal);
        }
        //超大单
        else {
            if ("U".equals(kind)){
                superBigAmountTotal = superBigAmountTotal.add(value);
            } else if ("D".equals(kind)){
                superBigAmountTotal = superBigAmountTotal.subtract(value);
            }
//                else if ("E".equals(kind)){
//                    superBigAmountTotal = superBigAmountTotal.subtract(value);
//                }
            result.put("superBigAmountTotal",superBigAmountTotal);
        }
        if (amountTotal != null) {
            if ("U".equals(kind)){
                amountTotal = amountTotal.add(value);
            } else if ("D".equals(kind)){
                amountTotal = amountTotal.subtract(value);
            }
//                else if ("E".equals(kind)){
//                    superBigAmountTotal = superBigAmountTotal.subtract(value);
//                }
            result.put("amountTotal",amountTotal);
        }
        return result;
    }

    private static JSONArray getMinuteFunds(@NotNull String stockAreaStockCode,@NotNull Integer amount){
        String nowDate = DateUtil.dateToString(new Date(),"yyyy-MM-dd");
        HttpHeaders headers = new HttpHeaders();
        headers.set(HttpHeaders.USER_AGENT,"Mozilla/5.0 (Macintosh; Intel Mac OS X 10.6; rv:9.0) Gecko/20100101 Firefox/9.0");
        headers.set(HttpHeaders.REFERER,"https://vip.stock.finance.sina.com.cn/quotes_service/view/cn_bill.php?symbol="+stockAreaStockCode);
        String r = HttpClientUtil.getWithHeader("https://vip.stock.finance.sina.com.cn/quotes_service/api/json_v2.php/CN_Bill.GetBillList?symbol="+stockAreaStockCode+"&num=6000&page=1&sort=ticktime&asc=0&volume=0&amount="+amount+"&type=0&day="+nowDate,headers);
        JSONArray result = JSONArray.parseArray(r);
        return result;
    }


